import React from "react";
function Navbar() {
  return (
    <>
      <div>
        <div>
          <div>
            <ul
              style={{
                font: "Montserrat",
                fontSize: "16px",
                fontWeight: "500",
                display: "flex",
                gap: "36px",
                listStyleType: "none",
              }}
            >
              <li>Home</li>
              <li>About Me</li>
              <li>Services</li>
              <li>Portfolio</li>
              <li>Contact</li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
}

export default Navbar;
